import React from "react";
import './style.css';
import gitHubImg from "../../img/github.jpg";
import linkedInImg from "../../img/link"

const contactStyle = {
    textAlign:"center",
    marginTop: "15%",
    color: "beige",
    fontSize: "25px"
}

const ContactForm = () => {
    return (<>
    <div style={contactStyle}>
        <h1>Social Media Links</h1>
    </div>
        </>
    )
}

export default ContactForm;
